// import logo from './logo.svg';
import './App.css';
import Data from './components/Data';
import Navbar from './components/Navbar';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";

function App() {
  return (
    <div>
      <Router>
        <Navbar />
        <Data />
          <Switch>
            <Route exact path="/"> <News key="general" category="general" /> </Route>
          </Switch>
      </Router>
    </div>
  );
}

export default App;
